package ua.ksstroy.convert;import ua.ksstroy.logic.zone.ZoneGroup;import ua.ksstroy.logic.zone.ZoneGroupImpl;import ua.ksstroy.models.zone.GroupsModel;public class GroupsModelToGroupConverter implements Converter<GroupsModel, ZoneGroup> {    public ZoneGroup convert(GroupsModel group) {        ZoneGroup zoneGroup = new ZoneGroupImpl();        zoneGroup.setId(group.getId());        zoneGroup.setName(group.getName());        return zoneGroup;    }}